import React, { useState } from "react";
import { Link, NavLink } from "react-router-dom";
import "./index.css";
import { Container } from "react-bootstrap";
import "../../styles/components/NavBar/index.css";

const BottomNav = (props) => {
  return (
    <Container className="bottom-nav">
      <NavLink className="explore">
        <i class="fas fa-search"> Explore</i>
      </NavLink>
      <NavLink className="add-product">
        <i class="fas fa-plus"> Add</i>
      </NavLink>
      <NavLink className="profile">
        <i class="fas fa-user"> Profile</i>
      </NavLink>
    </Container>
  );
};

export default BottomNav;
